import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import data from'./data';
import './index.css';

ReactDOM.render(<>
	<Card
	imgsrc={data[0].imgsrc}
	title={data[0].title}
	sname={data[0].sname}
	link={data[0].link}
	/>
	<Card
	imgsrc={data[1].imgsrc}
	title={data[1].title}
	sname={data[1].sname}
	link={data[1].link}
	/>
	</>
	,document.getElementById("root"));
